class Solution {

    /**
     * @param Integer[] $nums
     * @param Integer $k
     * @param Integer $dist
     * @return Integer
     */
    function minimumCost($nums, $k, $dist) {
        $n = count($nums);
        $prefixSum = array_fill(0, $n + 1, 0);
        for ($i = 1; $i <= $n; $i++) {
            $prefixSum[$i] = $prefixSum[$i - 1] + $nums[$i - 1];
        }

        $dp = array_fill(0, $k + 1, array_fill(0, $n + 1, PHP_INT_MAX));
        for ($i = 0; $i <= $n; $i++) {
            $dp[1][$i] = $nums[0];
        }

        for ($i = 2; $i <= $k; $i++) {
            for ($j = $i - 1; $j <= $n; $j++) {
                for ($m = $i - 2; $m <= min($j - 1, $i - 2 + $dist); $m++) {
                    $dp[$i][$j] = min($dp[$i][$j], $dp[$i - 1][$m] + $nums[$j - 1]);
                }
            }
        }

        return $dp[$k][$n];
    }
}
